import React from 'react';
import ReportHeader from './ReportHeader';

function ReportComponent(){

    return(
        <div>
            <div>Event Name: asdf </div>
            <div>Time: </div>
            <div><Button variant="contained" color="primary" onClick={()=>history.push("/report")}>
                Primary
            </Button></div>
        </div>
    );
}

export default ReportComponent;
